var keypad = [[1,2,3], [4,5,6], [7,8,9]];
var input = ["",
"",
"",
"",
""];
var position = [1,1];
var answer = [];
for (var i = 0; i < input.length; i++)
{
  var instructions = input[i];
  for (var j = 0; j < instructions.length; j++)
  {
    if (instructions[j] == "U" && position[0] !== 0)
    {
      position[0]--;
    }
    
    else if (instructions[j] =="L" && position[1] !== 0)
    {
      position[1]--;
    }
    
    else if (instructions[j] == "R" && position[1] != 2)
    {
      position[1]++;
    }
    
    else if (instructions[j] == "D" && position[0] != 2)
    {
      position[0]++;
    }
  }
  answer.push(keypad[position[0]][position[1]]);
}

console.log("The bathroom keycode is " + answer.join('') + ".");